现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "(1) 名义工况（数值，三位有效数字，SI）": {
    "R_A": "[字符串]",
    "R_B": "[字符串]",
    "M_max": "[字符串]",
    "x_Mmax": "[字符串]",
    "剪力关键值": {
      "V(0+)": "[字符串]",
      "V(a−)": "[字符串]",
      "V(a+)": "[字符串]",
      "V(L−)": "[字符串]"
    },
    "弯矩关键值": {
      "M(0)": "[字符串]",
      "M(a−)": "[字符串]",
      "M(a+)": "[字符串]",
      "M(L)": "[字符串]"
    },
    "零剪力位置": "[字符串]"
  },
  "(2) 镜像工况（数值，三位有效数字，SI）": {
    "R_A'": "[字符串]",
    "R_B'": "[字符串]",
    "M_max'": "[字符串]",
    "x_Mmax'": "[字符串]"
  },
  "(3) 公差分析两端点与最不利包络（数值，三位有效数字，SI）": {
    "x = 2.80 m": {
      "R_A": "[字符串]",
      "R_B": "[字符串]",
      "M_max": "[字符串]",
      "x_Mmax": "[字符串]"
    },
    "x = 3.20 m": {
      "R_A": "[字符串]",
      "R_B": "[字符串]",
      "M_max": "[字符串]",
      "x_Mmax": "[字符串]"
    },
    "最不利M_max包络": {
      "M_max,envelope": "[字符串]",
      "发生位置": "[字符串]"
    }
  },
  "(4) 关系与图件清单（符号/文字）": {
    "力的平衡关系": "[数学方程字符串]",
    "零剪力与弯矩极值关系": "[字符串]",
    "图件清单": "[3个字符串的数组]"
  }
}
